var script = tempVars("eval").toString();
var oldResult = tempVars("result").toString();
var newResult = [];
var isJSON = false;

newResult.push('"object":{');

if(typeof(tempVars("result")) == 'object') {
  tempVars("result").forEach(item => {
    newResult.push(`"${item.toString()}"`);
  });
  newResult.push('}');
  isJSON = true;
} else {
  isJSON = false;
};

var embed = new Discord.RichEmbed();
embed.setTitle("Eval ✅");
embed.setColor("#77b255");
if(isJSON == true) {
  embed.addField("Eingabe", "```js\n" + script + "\n```", false);
  embed.addField("Ausgabe", "```json\n" + newResult.join(",\n").replace("{,\n", "{\n").replace(",\n}", "\n}") + "\n```", false);
} else {
  embed.addField("Eingabe", "```js\n" + script + "\n```", false);
  embed.addField("Ausgabe", "```js\n" + oldResult + "\n```", false);
};
msg.channel.send(embed);

